import '../../App.css';
import React from "react";
import HomePage from "../HomePage/HomePage";
import Footer from "../Footer/Footer";
import HomePage2 from "../HomePage/HomePage2";
import Cards from "../Card/Cards";

function Home() {
    return (
        <div className='homepage-container'>
            <HomePage/>
            <HomePage2/>
            <Cards/>
            <Footer/>
        </div>
    )
}

export default Home;
